export default function NavBar() {
    return (
        <nav className="nav">
            <a href="/" className="site-title">Home</a>
            <ul>
                <li><a href="/About">About</a></li>
                <li><a href="/Contact">Contact</a></li>
            </ul>
        </nav>
    )
}
